    const fetchnews=()=>{
        axios.get("https://newsapi.org/v2/everything?q=bitcoin&apiKey=888c604dc40544ff992fd30a60cf6998")
        .then((response)=>{
            console.log(response.data.articles);
            setData(response.data.articles);
        });
    }
    return (
        <div>
            <h1>Hii There!!!</h1>
            <button onClick={fetchnews}>Fetch News</button>
            <div className="news">
                
            </div>

        </div>
    )

}
export default News;
